INSERT INTO `config` (`id`, `name`, `value`) VALUES
(1, 'marketing_team_member_message', 'عزيزي التاجر! هل تريد تحويل عملية البيع لديك إلى رحلة ممتعة؟\r\nاشترك الآن في نظام نقاط البيع لدينا واستمتع بمزايا لا مثيل لها:\r\n\r\nتوفير الوقت والجهد: وداعاً لطوابير الانتظار الطويلة! نظام نقاط البيع لدينا سريع وسهل الاستخدام، مما يوفر لك الوقت الثمين لتركيز على عملائك.\r\n\r\nإدارة المخزون بسهولة: قل وداعاً لأوراق الجرد المرهقة! نظام نقاط البيع لدينا يتتبع مخزونك تلقائياً، مما يمنحك رؤية واضحة لمبيعاتك ويمنع نفاد المنتجات.\r\n\r\nتحسين تجربة العميل: قدم لعملائك تجربة سلسة وحديثة مع نظام نقاط البيع لدينا. سيتمكنون من الدفع بسرعة وسهولة، وستحصل أنت على تقييمات إيجابية.\r\n\r\nتحليل المبيعات بذكاء: اكتشف أفضل المنتجات لديك، وأوقات الذروة، وأنماط شراء العملاء باستخدام تقارير المبيعات الشاملة لنظام نقاط البيع.\r\n\r\nعروض وخصومات جذابة: استخدم نظام نقاط البيع لإنشاء عروض وخصومات مخصصة لعملائك، وزد من ولائهم واربح أكثر.\r\n\r\nاشترك الآن واحصل على:\r\n\r\nشهر مجاني لتجربة نظام نقاط البيع لدينا دون أي التزام.\r\nدعم فني على مدار الساعة لتساعدك في كل خطوة.\r\nباقة أسعار تنافسية لتناسب احتياجات عملك.\r\nلا تتأخر! زادت مبيعاتك واربح أكثر مع نظام نقاط البيع لدينا.\r\n\r\nاتصل بنا الآن على [رقم الهاتف] أو زيارة موقعنا [رابط الموقع] للمزيد من المعلومات.\r\n\r\n#نظام_نقاط_البيع #تحسين_المبيعات #إدارة_المخزون #تجربة_عميل_رائعة\r\n\r\nنحن نؤمن بأن نظام نقاط البيع لدينا يمكن أن يساعدك في تحقيق أهدافك التجارية. اشترك معنا اليوم واختبر الفرق!');

